define('text',{load: function(id){throw new Error("Dynamic load not allowed: " + id);}});
define('text!views/detail.html',[],function () { return '<div class="messageBox autoclose" style="max-width: 425px">\n    <div class="modal-header">\n        <h3>Details</h3>\n    </div>\n    <div class="modal-body">\n        <p data-bind="html: description"></p>\n    </div>\n</div>';});

define('text!views/home.html',[],function () { return '<h3>Moped</h3>\n<p>Moped is an HTML frontend for the <a href="http://www.mopidy.com/">Mopidy music server</a>.</p>\n<h4>Search</h4>\n<p>Find artists, albums or tracks.</p>\n<h4>Playlists</h4>\n<p>All playlists appear in the left menu. Select and play.</p>\n<h4>Radio</h4>\n<p>\n  Moped can play radio streams. Select \'Radio\', enter the stream address and play. It\'s possible to store radio stations locally by starring. These stations will appear in the left menu.\n  Alternatively, you can also search for radio streams.\n</p>';});

define('text!views/notconnected.html',[],function () { return '<h3>Not connected to a server. Please try again</h3>';});

define('text!views/nowplaying.html',[],function () { return '<div>\n  <div class="col-xs-12 col-sm-6 track">\n    <img class="nowplaying-thumb" data-bind="attr: { src: currentTrackImageUrl }" />\n    <a class="albumlink" href="#" data-bind="attr: { href: \'#album/\' + currentAlbumUri }"><h5 data-bind="text: currentTrack">Track title</h5></a>\n    <div data-bind="foreach: currentArtists">\n      <a class="artistlink" href="#" data-bind="attr: { href: \'#artist/\' + uri + \'/\' + name}, text: name"></a>\n    </div>    \n  </div>\n  <div class="clearfix visible-xs"></div>\n  <div class="col-xs-12 col-sm-6 transport">\n    <div class="time">\n      <div class="pull-left" data-bind="text: currentTrackPosition"></div>\n      <div class="pull-right" data-bind="text: currentTrackLengthString"></div>\n      <div class="clearfix"></div>\n    </div>\n    <div class="time-slider-container">\n      <input type="text" class="time-slider" name="timeposition" data-slider-min="0" data-slider-max="100" data-slider-step="1" data-slider-selection="before" data-slider-value="0" data-slider-tooltip="hide">\n    </div>\n  </div>\n</div>';});

define('text!views/playercontrols.html',[],function () { return '<ul class="list-inline">\n  <li><a href="#" class="glyphicon glyphicon-fast-backward" role="button" data-bind="click: previous"></a></li>\n  <li><a href="#" class="glyphicon" data-bind="css: { \'glyphicon-play\': ! isPlaying, \'glyphicon-pause\': isPlaying }, click: play" role="button"></a></li>\n  <li><a href="#" class="glyphicon glyphicon-fast-forward" role="button" data-bind="click: next"></a></li>\n  <li>\n    <input type="text" class="volume-slider" name="volume" data-slider-min="0" data-slider-max="100" data-slider-step="1" data-slider-selection="before" data-slider-tooltip="hide">\n  </li>\n  <li>\n    <span class="glyphicon glyphicon-volume-up" />\n  </li>\n</ul>';});

define('text!views/settings.html',[],function () { return '<form role="form">\n  <h3>Settings</h3>\n  <label for="mopidyUrl">Mopidy Web Socket url</label>\n  <div class="form-group row">\n  \t<div class="col-sm-9">\n    \t<input type="text" class="form-control" id="mopidyUrl" data-bind="value: settings.mopidyUrl">\n      <span class="help-block">Leave empty for default, example url: ws://hostname:6680/mopidy/ws/</span>\n    </div>\n    <div class="col-sm-3">\n      <button class="btn btn-default" data-bind="click: verifyConnection">Verify connection</button>\n    </div>\n  </div>\n  <button type="submit" class="btn btn-primary" data-bind="click: saveSettings">Save settings</button>\n</form>';});

define('text!views/shell.html',[],function () { return '<div>\n  <aside id="menu" class="menu pane-col scroll-y">\n    <div data-bind="compose:\'viewmodels/search/search\'"></div>\n    <div data-bind="compose:\'viewmodels/playlists/menu\'"></div>\n    <div data-bind="compose:\'viewmodels/radio/menu\'"></div>\n    <div class="panel">\n      <a href="#settings"><div class="panel-heading settings">Settings</div></a>\n    </div>\n  </aside>\n\n  <div class="main pane-col" data-bind="css: { outtaway: isSidebarVisible }">\n    \n    <header>\n      <button type="button" class="navbar-toggle" data-toggle="collapse" data-bind="click: toggleSidebar, css: { outtaway: isSidebarVisible }">\n        <span class="sr-only">Toggle navigation</span>\n        <span class="icon-bar"></span>\n        <span class="icon-bar"></span>\n        <span class="icon-bar"></span>\n      </button>\n      <div class="title-bar">\n        <div class="pull-right">\n          Status: <span data-bind="text: connectionState">\n        </div>\n        <a href="#" data-bind="click: goBack, visible: isBackVisible">Back</a>\n        <a href="#">Home</a>\n      </div>\n    </header>\n\n    <section id="maincontent" class="maincontent pane-row scroll-y">\n      <div class="container" data-bind="router: { }">\n\n      </div>\n    </section>\n\n    <section class="nowplaying pane-row">\n      <div data-bind="compose:\'viewmodels/nowplaying\'"></div>\n    </section>\n\n    <section class="controls pane-row">\n      <div data-bind="compose:\'viewmodels/playercontrols\'"></div>\n    </section>\n  </div>\n</div>';});

define('text!views/browse/album.html',[],function () { return '<div data-bind="foreach: albums">\n  <!-- ko widget : {kind: \'album\', album: $data, tracks: $parent.tracks } -->\n\n  <!-- /ko -->\n</div>';});

define('text!views/browse/artist.html',[],function () { return '<div class="row view-title">\n  <h3 data-bind="text: artist.name"></h3>\n  <div data-bind="widget: {kind: \'artistimage\', artistName: artist.name, imageSize: \'extralarge\' }" class="pull-right" />\n  <p data-bind="html: artistSummary"></p>\n</div>\n<div class="row" data-bind="visible: albums.length > 0">\n  Albums\n  <hr>\n</div>\n<div data-bind="foreach: albums">\n  <div data-bind="widget: {kind: \'album\', album: album, tracks: tracks }">\n    <h3 class="pull-left" data-part="aname">\n      <a href="#" data-bind="text: album.name, attr: { href: \'#album/\' + album.uri }"></a>\n    </h3>\n    <div class="hidden" data-part="albumartist"></div>\n  </div>\n</div>\n<div class="row" data-bind="visible: singles.length > 0">\n  Singles\n  <hr>\n</div>\n<div data-bind="foreach: singles">\n  <div data-bind="widget: {kind: \'album\', album: album, tracks: tracks, imageSize: \'medium\' }">\n    <h3 class="pull-left" data-part="aname">\n      <a href="#" data-bind="text: album.name, attr: { href: \'#album/\' + album.uri }"></a>\n    </h3>\n    <div class="hidden" data-part="albumartist"></div>\n  </div>\n</div>\n<div class="row" data-bind="visible: appearsOn.length > 0">\n  Appears on\n  <hr>\n</div>\n<ul class="albumimagelist" data-bind="foreach: appearsOn">\n  <li data-bind="widget: {kind: \'albumimage\', album: album, imageSize: \'large\' }">\n  </li>\n</ul>\n';});

