define('text!views/playlists/menu.html',[],function () { return '<div class="panel">\n  <div class="panel-heading playlists">Playlists</div>\n  <div class="panel-body">\n    <div class="list-group" data-bind="foreach: playlists">\n      <a class="list-group-item" data-bind="attr: { href: \'#playlist/\' + uri }"><span class="glyphicon glyphicon-music"></span> <span data-bind="text: name"></a>\n    </div>    \n  </div>\n</div>\n';});

define('text!views/radio/menu.html',[],function () { return '<div class="panel">\n  <a href="#radio"><div class="panel-heading radio">Radio</div></a>\n  <div class="panel-body">\n    <div class="list-group" data-bind="foreach: radiostations">\n      <a class="list-group-item" data-bind="attr: { href: \'#radio/\' + name }"><span class="glyphicon glyphicon-star"></span> <span data-bind="text: name"></a>\n    </div>    \n  </div>\n</div>\n';});

define('text!views/radio/radio.html',[],function () { return '<h3>Radio</h3>\n<form role="form">\n  <div class="row">\n    <div class="form-group col-sm-3">\n      <label for="streamName">Radio station name</label>\n      <input type="text" class="form-control" id="streamName" data-bind="value: currentStreamName">\n    </div>\n    <div class="form-group col-sm-5">\n      <label for="streamUri">Radio stream address</label>\n      <input type="text" class="form-control" id="streamUri" data-bind="value: currentStreamUri">\n    </div>\n    <div class="form-group col-sm-4">\n      <label>&nbsp;</label>\n      <br>\n      <button class="btn btn-primary" data-bind="click: play">Play</button>\n      <button class="btn btn-default" data-bind="click: addToFavourites, visible: canAddToFavourites">\n        <span class="glyphicon glyphicon-star"></span> Star\n      </button>\n      <button class="btn btn-default" data-bind="click: removeFromFavourites, visible: canRemoveFromFavourites">\n        <span class="glyphicon glyphicon-star-empty"></span> Unstar</button>\n    </div>\n  </div>\n</form>\n<p>\nor\n</p>\n<form role="form">\n  <label for="searchQuery">Find Radio streams (experimental)</label>\n  <div class="form-group row">\n    <div class="col-sm-4">\n      <input type="text" class="form-control" id="searchQuery" data-bind="value: searchQuery">\n    </div>\n    <div class="col-sm-4">\n      <button class="btn btn-primary" data-bind="click: findStream">Find</button>\n    </div>\n  </div>\n</form>\n<div class="list-group" data-bind="foreach: searchResults">\n  <div class="list-group-item row">\n    <h4 class="col-xs-6 list-group-item-heading" data-bind="text: name"></h4>\n    <div class="col-xs-3" data-bind="text: country"></div>\n    <div class="col-xs-3">\n      <button class="btn btn-default" data-bind="click: $parent.playStream.bind($parent, name, streamurl)">Play</button>\n    </div>\n    <div class="col-xs-9 hidden-xs">\n      <a href="#" data-bind="attr: { href: website }, text: website"></a> \n    </div>\n    <div class="col-xs-3 hidden-xs" data-bind="text: bitrate"></div>\n  </div>\n</div>\n<p>Search powered by http://dirble.com & http://whateverorigin.org</p>';});

define('text!views/search/results.html',[],function () { return '<br>\n<p>Showing results for <em data-bind="text: query" /><p>\n<div class="row view-title">\n  <div class="col-sm-6">\n    <h3>Artists</h3>\n    <ul class="artistimagelist" data-bind="foreach: artists">\n      <li>\n        <a href="#" data-bind="attr: { href: \'#artist/\' + uri + \'/\' + name }">\n          <!-- ko widget : {kind: \'artistimage\', artistName: name, imageSize: \'large\'} -->\n          <!-- /ko -->\n          <div data-bind="text: name"></div>\n        </a>\n      </li>\n    </ul>\n  </div>\n  <div class="clearfix visible-xs"></div>\n  <div class="col-sm-6">\n    <h3>Albums</h3>\n    <ul class="albumimagelist" data-bind="foreach: albums">\n      <li data-bind="widget: {kind: \'albumimage\', album: $data, imageSize: \'large\' }">\n      </li>\n    </ul>\n  </div>\n</div>\n<div class="row">\n  <div class="col-xs-12">\n    <h3>Tracks</h3>\n  </div>\n</div>\n<div class="list-group" data-bind="foreach: tracks">\n  <!-- ko widget : {kind: \'track\', track: $data, tracklist: $parent.tracks, idx: $index()} -->\n  <!-- /ko -->\n</div>\n';});

define('text!views/search/search.html',[],function () { return '<div class="panel">\n  <div class="panel-heading search">Search</div>\n  <div class="panel-body">\n    <form class="form-inline">\n      <div class="form-group">\n        <input type="text" class="form-control" placeholder="Search" name="query" data-bind="value: query" />\n        <input type="submit" value="Find" data-bind="click: find" class="btn-search" />\n      </div>\n    </form>\n  </div>\n</div>\n';});

define('text!widgets/album/view.html',[],function () { return '<div class="row view-title">\n  <h3 class="pull-left" data-part="aname" data-bind="html: album.name"></h3>\n  <div class="pull-left title-date" data-bind="text: album.date"></div>\n  <h4 class="pull-right" data-part="albumartist" data-bind="foreach: album.artists">\n    <a class="artistlink" href="#" data-bind="attr: { href: \'#artist/\' + uri + \'/\' + name }, text: name"></a>\n  </h4> \n</div>\n<div class="row">\n  <div class="col-sm-3">\n    <img class="albumcover img-responsive" data-bind="attr: { src: albumImageUrl }" />\n  </div>\n  <div class="col-sm-9">\n    <div data-bind="foreach: discs">\n      <div data-bind="text: \'Disc \' + ($data.disc), visible: $parent.discs.length > 1"></div>\n      <div class="list-group" data-bind="foreach: $data.tracksOnDisc">\n        <!-- ko widget : {kind: \'track\', track: $data, tracklist: $parent.tracksOnDisc, idx: $index()} -->\n          <div class="col-xs-1" data-part="trackno" data-bind="text: track.track_no"></div>\n          <h4 class="col-xs-10 list-group-item-heading" data-part="trackname" data-bind="text: track.name"></h4>\n          <div class="hidden" data-part="xs-sep1"></div>\n          <div class="hidden" data-part="xs-sp1"></div>\n          <h4 class="hidden" data-part="trackartists" data-bind="text: getArtistsAsString()"></h4>\n          <div class="col-xs-1" data-part="trackduration" data-bind="text: getDuration()"></div>\n          <div class="hidden" data-part="xs-sep2"></div>\n          <div class="hidden" data-part="xs-sp1"></div>\n          <div class="hidden" data-part="albumname" data-bind="text: track.album.name"></div>\n          <div class="hidden" data-part="albumdate" data-bind="text: track.album.date"></div>\n        <!-- /ko -->\n      </div>\n    </div>\n  </div>\n</div>\n';});

define('text!widgets/albumimage/view.html',[],function () { return '<a href="#" data-bind="attr: { href: \'#album/\' + album.uri, title: album.name }">\n  <img class="img-responsive" data-bind="attr: { src: albumImageUrl }" />\n  <div data-bind="text: album.name" />\n</a>';});

