define('text!widgets/track/view.html',[],function () { return '<a href="#" class="list-group-item row" data-bind="click: playTrack, css: { active: isPlaying }">\n  <div class="col-xs-1" data-part="trackno" data-bind="text: getItemIndex()"></div>\n  <h4 class="col-xs-10 col-sm-5 list-group-item-heading" data-part="trackname" data-bind="text: track.name"></h4>\n  <div class="clearfix visible-xs" data-part="xs-sep1"></div>\n  <div class="col-xs-1 visible-xs" data-part="xs-sp1"></div>\n  <h4 class="col-xs-9 col-sm-5 list-group-item-heading" data-part="trackartists" data-bind="text: getArtistsAsString()"></h4>\n  <div class="col-xs-1" data-part="trackduration" data-bind="text: getDuration()"></div>\n  <div class="clearfix hidden-xs" data-part="xs-sep2"></div>\n  <div class="col-md-1 hidden-xs" data-part="xs-sp1"></div>\n  <div class="col-md-5 hidden-xs" data-part="albumname" data-bind="text: track.album.name"></div>\n  <div class="col-md-5 hidden-xs" data-part="albumdate" data-bind="text: track.album.date"></div>\n</a>\n';});

